import React from "react";
import { Outlet } from "react-router-dom";
import Navbar from "../components/UI/Navbar";
import Footer from "../components/UI/Footer";

const RootLayout = (props) => {
    return (
        <>
            <Navbar/>
            {props.children}
            <Footer/>
        </>
    );
}

export default RootLayout;
